import React from "react";

function Transaction({ description, date, category, id, amount, deleteList }) {
  return (
    <tr>
      <td>{date}</td>
      <td>{description}</td>
      <td>{category}</td>
      <td>{amount}</td>
      <td>
        <button
          style={{ color: "red", borderRadius: "3px" }}
          onClick={() => deleteList(id)}
        >
          DELETE
        </button>
      </td>
    </tr>
  );
}

export default Transaction;
